import React from 'react';
import ReactDOM from 'react-dom/client';
import user from './user.json';
import './styles.css';

const imageUrl =
  'https://images.pexels.com/photos/461198/pexels-photo-461198.jpeg?dpr=2&h=480&w=640';
const price = 10.99;

//console.log(test);
console.log(user.stats);

const Profile = ({username, tag, avatar, location, stats : {followers, views, likes}}) => {
  //console.log(username);
  //console.log(props.props.username);
  return (
  <div className="profile">
  <div className="description">
    <img
      src={avatar}
      alt="User avatar"
      className="avatar"
    />
    <p className="name">{username}</p>
    <p className="tag">@{tag}</p>
    <p className="location">{location}</p>
  </div>

  <ul className="stats">
    <li>
      <span className="label">Followers</span>
      <span className="quantity">{followers}</span>
    </li>
    <li>
      <span className="label">Views</span>
      <span className="quantity">{views}</span>
    </li>
    <li>
      <span className ="label">Likes</span>
      <span className="quantity">{likes}</span>
    </li>
  </ul>
</div>
)};

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(<Profile username={user.username} tag={user.tag} avatar={user.avatar} location={user.location} stats={user.stats}
   />);

  export default <Profile username={user.username} tag={user.tag} avatar={user.avatar} location={user.location} stats={user.stats}
  />;
